--update types from quiz to lab
DELETE
FROM
    KSEN_LUI_RELATED_LUI_TYPES
WHERE
    RELATED_LUI_TYPE='kuali.lui.type.activity.offering.quiz'
AND LUI_ID='e08c6623-4eee-42b5-a7bd-bcf3cb836991'
/
INSERT
INTO
    KSEN_LUI_RELATED_LUI_TYPES
    (
        KSEN_LUI_RELATED_LUI_TYPES.RELATED_LUI_TYPE,
        KSEN_LUI_RELATED_LUI_TYPES.LUI_ID
    )
    VALUES
    (
        'kuali.lui.type.activity.offering.lab',
        'e08c6623-4eee-42b5-a7bd-bcf3cb836991'
    )
    /
UPDATE
    KSEN_LUI
SET
    LUI_TYPE='kuali.lui.type.activity.offering.lab'
WHERE
    id IN
    (
        SELECT
            l.id
        FROM
            KSEN_LUI l,
            KSEN_LUILUI_RELTN r
        WHERE
            r.LUI_ID='e08c6623-4eee-42b5-a7bd-bcf3cb836991'
        AND l.ID=r.RELATED_LUI_ID
        AND Lui_TYPE='kuali.lui.type.activity.offering.quiz'
    )
    /
UPDATE
    KSLU_CLU
SET
    KSLU_CLU.LUTYPE_ID='kuali.lu.type.activity.Lab'
WHERE
    KSLU_CLU.ID='067a873d-5308-4802-81bf-5b6502fa679a'
    /
UPDATE
    KSEN_LUI_IDENT
SET
    SHRT_NAME='LC/LB',
    LNG_NAME='Lecture/Lab'
WHERE
    ID='707B32C05C89400BA1A631BDD4DF160D'
    /
UPDATE
    KSLU_CLU_IDENT
SET
    SHRT_NAME='LC/LB',
    LNG_NAME='Lecture/Lab'
WHERE
    ID='B219CCB82EBA4586BF4DBDCA031AE728'
    /

